  // function () payable {
  //     // require('');
  //     uint amount = msg.value;
  //     balanceOf[msg.sender] += amount;
  //     // amountRaised += amount;
  //     // tokenReward.transfer(msg.sender, amount / price);
  //     // TODO
  //     FundTransfer(msg.sender, amount, true);
  // }

  // Disco
  function newDisco(
    string memory id,
    address walletAddr,
    address tokenContract,
    string memory description,
    uint256 fundRaisingTimeFrom,
    uint256 fundRaisingTimeTo,
    uint256 investmentReward,
    uint256 rewardDeclineRate,
    uint256 shareToken,
    uint256 minFundRaising,
    uint256 addLiquidityPool,
    uint256 totalDepositToken
  ) public {
    require(_coinbase != address(0));
    DiscoInfo memory d = DiscoInfo(
      walletAddr,
      tokenContract,
      description,
      fundRaisingTimeFrom,
      fundRaisingTimeTo,
      investmentReward,
      rewardDeclineRate,
      shareToken,
      minFundRaising,
      addLiquidityPool,
      totalDepositToken
    );
    DiscoStatus memory s = DiscoStatus(
      false,
      false,
      false
    );
    discos[id] = d;
    status[id] = s;
    
    // disco 
    emit createdDisco(id);
  }

    // 
  function enableDisco(string memory id) public {
    require(discos[id].fundRaisingTimeFrom > now);
    require(discos[id].fundRaisingTimeTo < now);
    require(!status[id].isEnabled);
    status[id].isEnabled = true;
    // 
    emit enabeldDisco(id);
  }


  //  disco
  function getDisco(string memory id) public view 
  returns(
    address walletAddr,
    address tokenContract,
    string memory description
    // uint256 fundRaisingTimeFrom,
    // uint256 fundRaisingTimeTo,
    // uint256 investmentReward,
    // uint256 rewardDeclineRate,
    // uint256 shareToken,
    // uint256 minFundRaising,
    // uint256 addLiquidityPool,
    // uint256 totalDepositToken
  ) {
    return (
      discos[id].walletAddr,
      discos[id].tokenContract,
      discos[id].description
      // discos[id].fundRaisingTimeFrom,
      // discos[id].fundRaisingTimeTo,
      // discos[id].investmentReward,
      // discos[id].rewardDeclineRate,
      // discos[id].shareToken,
      // discos[id].minFundRaising,
      // discos[id].addLiquidityPool,
      // discos[id].totalDepositToken
    );
  }

  // // 
  // function finishedDisco(string memory id) public returns(bool) {
  //   require(!status[id].isFinished);
  //   status[id].isFinished = true;

  //   // TODO 
  //   if ('') {
  //     status[id].isSuccess = true;
  //     // TODO  swap
  //   } else {
  //     status[id].isSuccess = false;
  //   }
  //   emit fundraisingFinished(id);
  // }

  // ,  
  function investor(
      string memory id,
      address investorAddress,
      uint256 value,
      uint256 time,
      uint256 sharedToken,
      uint256 rewardedToken
    ) public {
     DiscoInvestor memory i = DiscoInvestor(
      investorAddress, 
      value, 
      time,
      sharedToken,
      rewardedToken
    );
    investors[id] = i;
  }
}
